import React from "react";
import {
  Button,
  Checkbox,
  Form,
  Input,
  Radio,
  Select,
  TextArea,
} from "semantic-ui-react";

const QuizModal = () => {
  const options = [
    { key: "1", text: "Answer 1", value: "answer1" },
    { key: "2", text: "Answer 2", value: "answer2" },
    { key: "3", text: "Answer 3", value: "answer3" },
    { key: "4", text: "Answer 4", value: "answer4" },
  ];
  return (
    <Form>
      <Form.Field control={TextArea} label="Question" />
      <Form.Field control={Input} label="Answer 1" />

      <Form.Group widths="equal">
        <Form.Field control={Input} label="Answer 1" />
        <Form.Field control={Input} label="Answer 2" />
      </Form.Group>
      <Form.Group widths="equal">
        <Form.Field control={Input} label="Answer 3" />
        <Form.Field control={Input} label="Answer 4" />
      </Form.Group>
      <Form.Field control={Select} label="Correct Answer" options={options} />
      <Form.Field control={Button}>Submit</Form.Field>
    </Form>
  );
};

export default QuizModal;
